import React from "react";
import { useEffect } from "react";
import "./FAQs.css";

const FAQs = () => {
  useEffect(() => {
    const faqs = document.querySelectorAll(".faq");

    faqs.forEach((faq) => {
      const question = faq.querySelector(".question");

      question.addEventListener("click", () => {
        faq.classList.toggle("active");
      });
    });

    // Cleanup event listeners on component unmount
    return () => {
      faqs.forEach((faq) => {
        const question = faq.querySelector(".question");
        question.removeEventListener("click", () => {
          faq.classList.toggle("active");
        });
      });
    };
  }, []);

  return (
    <div className="Faqs">



      <div className="faq">
        <div className="question">
          <h3>What is the registration procedure?</h3>
          <svg width="15" height="10" viewBox="0 0 42 25">
            <path
              d="M3 3L21 21L39 3"
              stroke="white"
              stroke-width="7"
              stroke-linecap="round"
            />
          </svg>
        </div>
        <div className="answer">
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolor,
            maxime illum nostrum alias non quod iusto aspernatur minus deleniti,
            assumenda officiis modi. Est dolores harum possimus, dignissimos
            maiores nesciunt tempora.
          </p>
        </div>
      </div>

      <div className="faq">
          <div className="question">
            <h3> What will be the mode of conduct of the hackathon?</h3>
            <svg width="15" height="10" viewBox="0 0 42 25">
              <path
                d="M3 3L21 21L39 3"
                stroke="white"
                stroke-width="7"
                stroke-linecap="round"
              />
            </svg>
          </div>
          <div className="answer">
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolor,
              maxime illum nostrum alias non quod iusto aspernatur minus
              deleniti, assumenda officiis modi. Est dolores harum possimus,
              dignissimos maiores nesciunt tempora.
            </p>
          </div>
        </div>


    </div>
  );
};

export default FAQs;
